package com.example.fptacademysystem.dto;import java.io.Serializable;public class BranchDTO implements Serializable {    private int branchid;    private String branchnm;    private String removeat;    public BranchDTO() {        super();    }    public BranchDTO(int branchid, String branchnm, String removeat) {        super();        this.branchid = branchid;        this.branchnm = branchnm;        this.removeat = removeat;    }    public int getBranchid() {        return this.branchid;    }    public void setBranchid(int branchid) {        this.branchid = branchid;    }    public String getBranchnm() {        return this.branchnm;    }    public void setBranchnm(String branchnm) {        this.branchnm = branchnm;    }    public String getRemoveat() {        return removeat;    }    public void setRemoveat(String removeat) {        this.removeat = removeat;    }}